import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import IndecisionApp from './component/IndecisionApp.js';
import Counter from './playground/counter-example';
import Visibility from './playground/build-it-visible';
import * as serviceWorker from './serviceWorker';


ReactDOM.render(<IndecisionApp />, document.getElementById('root'));

// ReactDOM.render(<IndecisionApp name="Andrew" age={26} option={['Option 1', 'Option 2', 'Option 3']} />, document.getElementById('root'));

